import React from 'react';
import { Tab, Nav } from 'react-bootstrap';

function Tabs() {
  return (
    <Tab.Container defaultActiveKey="tab1">
      <Nav variant="pills" className="mb-3 justify-content-center">
        <Nav.Item><Nav.Link eventKey="tab1">Tab 1</Nav.Link></Nav.Item>
        <Nav.Item><Nav.Link eventKey="tab2">Tab 2</Nav.Link></Nav.Item>
        <Nav.Item><Nav.Link eventKey="tab3">Tab 3</Nav.Link></Nav.Item>
      </Nav>
      <Tab.Content className="card p-4 shadow">
        <Tab.Pane eventKey="tab1"><p>Sample content for Tab 1</p></Tab.Pane>
        <Tab.Pane eventKey="tab2"><p>Sample content for Tab 2</p></Tab.Pane>
        <Tab.Pane eventKey="tab3"><p>Sample content for Tab 3</p></Tab.Pane>
      </Tab.Content>
    </Tab.Container>
  );
}

export default Tabs;
